import React, { Component } from 'react';

class SearchBar extends Component{
	constructor(props){
		super(props);
		this.state = {
			textValue: ""
		};
	}





	render(){
		return(
			<input type="text" onChange={this.onChange.bind(this)} value={this.state.textValue} />
		);
	}

}

export default SearchBar;
